- input: "TEXT\x1CC00007658\x1CTEXT-00001\x1C\x1CF3XA\x1CThis report is being amended
    in response to the Commission's request for additional information.    1.  The
    contribution from Chase Bank was actually a cashiers check from an individual
    and has not been clarified.    2.  The Committee received a letter, dated Oct
    12, 2012, that outlined the inkind contributions made on behalf of the Committee
    by the Democratric National Committee.  The inkinds reported match that letter.
    \   3.  The receipt from the VLM Cooperative was reported incorrectly and has
    now been corrected.    4.  The Residence Stipend reported on Schedule B was made
    by a written check.  The Committee does not maintain a petty cash fund.    5.
    \ The Committee has not exceeded its transfer authority on administrative transfers.
    \ Each transfer includes transactions from the preceeding 60 days, so the transfers
    in July included transactions from May and June.  All allocation transfers are
    calculated and recorded by our Committee compliance softwae and are currently
    correct.    6.  Additional addresses have been added for disbursements on Schedule
    H4.    7.  Travel on Schedule H4 has been further clarified.  All payroll related
    expenses reported on Schedule H4 supporting Line 21(a) were for the benefit of
    employees that spent 25% or less of their compensated time on Federal Election
    Activity. All fundraising and Event Expenses were for the benefit of the Committee
    and did not Support a Federal candidate. Any receipts on Line 15 or 17 were assessed
    at the usual and normal chrage.\n"
